// Xor 값 조회 함수
uint8_t get_Xor_value(int r, int idx, int v1, int v2) {
    if (r < 0 || r >= 9) return 0;
    if (idx < 0 || idx >= 96) return 0;
    if (v1 < 0 || v1 >= 16) return 0;
    if (v2 < 0 || v2 >= 16) return 0;

    return Xor[r][idx][v1][v2];
}

